        this.set(this.dashboardPageInfoHeaderLanguageItemName, { language: `fi`, value: `Sivun ohjeet: Päävalikko` }, { language: `sv`, value: `Sidanvisningar: Huvudmeny` }, { language: `pl`, value: `Menu główne` }, { language: `nb`, value: `Sideveiledning: Hovedmeny` }, { language: `en`, value: `Page instructions: Main menu` }, { language: `da`, value: `Side instruktioner: Hovedmenu` },);
        this.set(this.dashboardPageInfoContentLanguageItemName, { language: `fi`, value: `Tervetuloa Renta Toolsiin!<br/><br/>Tämä on Renta Toolsin etusivu. Täältä voit etsiä laitteita kirjoittamalla Renta-numeron tekstikenttään ja valitsemalla "Tunnista laite".<br/><br/>Valikon avulla voit myös avata erilaisia sivuja, kuten palautustarkastusluettelon, huolto- ja korjausluettelon, vuositarkastusluettelon tai tankkaus- ja puhdistusluettelon.<br/><br/>Oikeasta yläkulmasta voit avata nämä ohjeet, käyttää valikkopainikkeesta koko päävalikkoa (mukaan lukien tiliasetukset, usein kysytyt kysymykset, tuki ja uloskirjautuminen) sekä muuttaa Renta Toolsin näyttökieltä.<br/><br/>Pääset aina etusivulle painamalla vasemmassa yläkulmassa olevaa Renta Tools -logoa.<br/><br/>Vasemman yläkulman nuolipainikkeesta pääset yhden sivun taaksepäin, mutta voi käyttää myös selaimen Takaisin-painiketta.` }, { language: `sv`, value: `Välkommen till Renta Tools!<br/><br/>Detta är förstasidan i Renta Tools. Här kan du söka efter enheter genom att skriva Renta ID i textfältet och välja "Hitta enhet".<br/><br/>Du kan också använda menyn för att öppna olika sidor som retur, service- och reparationslista, årliga besiktningslista eller tanknings- och städlista.<br/><br/>Uppe till höger kan du öppna dessa instruktioner, komma åt hela menyn, inklusive kontoinställningar, support och utloggning, och ändra skärmspråket för Renta Tools.<br/><br/>Du kommer alltid till framsidan genom att trycka på Renta Tools logotyp i det övre vänstra hörnet.` }, { language: `pl`, value: `Witamy w Renta Tools!<br/><br/>Oto strona główna Renta Tools. Możesz tutaj wyszukać urządzenia po jego kodzie wybierając opcję "Znajdź urządzenie".\n\nMożesz także posłużyć się głównym menu, by dostać się do różnych stron, tj.: listy kontroli powrotnych, listy napraw i przeglądów, czy listy tankowania oraz mycia.\n\nW prawym górnym rogu możesz otworzyć instrukcje, uzyskać dostęp do pełnego menu, w tym także ustawień konta, pomocy technicznej i wylogowania, a także zmienić język wyświetlania Renta Tools.\n\nMożesz zawsze powrócić do strony głównej aplikacji naciskając w lewym górnym rogu logo Renta Tools.` }, { language: `nb`, value: `Velkommen til Renta Tools!<br/><br/>Dette er forsiden til Renta Tools. Her kan du søke etter enheter ved å skrive inn Renta ID i tekstfeltet og velge "Finn enhet".\n\nDu kan også bruke menyen til å åpne forskjellige sider som returinspeksjoner, service- og reparasjonsliste, årlige inspeksjoner eller drivstoff- og rengjøringsliste.\n\nFra øverst til høyre kan du åpne disse instruksjonene, få tilgang til hele menyen, inkludert kontoinnstillinger, support og utlogging, og endre skjermspråket til Renta Tools.\n\nDu kommer alltid til forsiden ved å trykke på Renta Tools-logoen i øvre venstre hjørne.` }, { language: `en`, value: `Welcome to Renta Tools!<br/><br/>This is the front page of Renta Tools. In here you can search for devices by typing the Renta ID to the  text field and selecting “Find device”.\n\nYou can also use the menu to open different pages like return inspections list, services and repairs list, annual inspections list or fueling and cleaning list.\n\nFrom the top right you can open these instructions, access the full menu, including also account settings, support and logging out, and change the screen language of Renta Tools.\n\nYou can always access the front page by pressing the Renta Tools logo in the upper left corner.` }, { language: `da`, value: `Velkommen til Renta Tools!<br/><br/>Dette er forsiden af Renta Tools. Her kan du søge efter individer ved at skrive Renta ID'et i tekstfeltet og vælge "Find enhed". \n\nDu kan også bruge menuen til at åbne forskellige sider som inspektionsliste, service og reparationer liste, årlige inspektionsliste eller brændstof- og rengøringsliste. \n\nFra øverste højre hjørne kan du åbne disse instruktioner, få adgang til den fulde menu, også kontoinstillinger, support og logge ud, og ændre skærmens sprog i Renta Tools. \n\nDu kan altid få adgang til forsiden ved at trykke på Renta Tools-logoet i øverste venstre hjørne.` },);
        this.set(this.annualInspectionsPageInfoHeaderLanguageItemName, { language: `fi`, value: `Sivun ohjeet: Vuosittaisten tarkastusten luettelo` }, { language: `sv`, value: `Sidanvisningar: Årlig besiktningslista` }, { language: `pl`, value: `Instrukcje do strony: Lista rocznych przeglądów` }, { language: `nb`, value: `Sideveiledning: Årskontroll liste` }, { language: `en`, value: `Page instructions: Annual inspections list` }, { language: `da`, value: `Vejledning : årlig inspektions liste` },);
        this.set(this.annualInspetionspageInfoContentLanguageItemName, { language: `fi`, value: `FI: TODO` }, { language: `sv`, value: `SV: TODO` }, { language: `pl`, value: `PL: TODO` }, { language: `nb`, value: `NB: TODO` }, { language: `en`, value: `EN: TODO` }, { language: `da`, value: `EN: TODO` },);
        this.set(this.annualInspectionsPageInfoContentLanguageItemName, { language: `fi`, value: `Tällä sivulla näkyvät jokaisen toimipisteen kaikki vuositarkastukset, mukaan lukien tulevat ja myöhäiset vuositarkastukset, menneet vuositarkastukset sekä suoritetut vuositarkastukset, jotka odottavat vielä huomautusten korjaamista.\n\nVoit käyttää välilehtiä Tulevat, Huomautukset ja Menneet valitaksesi, mitä vuositarkastusluetteloa haluat tarkastella.\n\nOranssin suodatinkuvakkeen avulla voit rajata luettelossa näkyviä kohteita. Voit esimerkiksi tarkastella vain yhden tuoteryhmän kaikkia laitteita.\n\nItse tarkastuslistasta löydät laitteen nimen, vuokraustunnuksen, tuoteryhmän, varastonumeron, laitteen tilan, edellisen tarkastuksen päivämäärän ja seuraavan tarkastuksen eräpäivän.\n\nKaikki laitteet on värikoodattu niiden tilan mukaan:\n\n<b>Valkoinen, ilman päivämääriä</b>\n\nVuosittaista tarkastustietoa ei ole saatavilla. Tämän laitteen tarkastustietueissa ei ole merkintöjä. Tarkista nämä laitteet ja syötä tarvittavat tiedot Renta Toolsiin.\n\n<b>Valkoinen, päivämäärillä</b>\n\nVuositarkastus on suoritettava yli kuukauden kuluttua.\n\n<b>Sininen</b>\n\nNäillä laitteilla on kuukausi aikaa vuositarkastukseen.\n\n<b>Keltainen</b>\n\nNäillä laitteilla on kaksi viikkoa aikaa vuositarkastukseen.\n\n<b>Punainen</b>\n\nVuositarkastus myöhässä! Seuraavan vuositarkastuksen eräpäivä on ylitetty.` }, { language: `sv`, value: `Denna sida visar alla årliga besiktningar för varje depå inklusive: kommande och sena årliga besiktningar, tidigare årliga besiktningar samt genomförda årliga besiktningar som fortfarande väntar på att anmärkningar ska korrigeras.\n\nDu kan använda flikarna Kommande, Anmärkningar och Dåtid för att välja vilken årsbesiktningslista du vill se.\n\nMed den orangea filterikonen kan du begränsa objekten som visas på listan. Du kan till exempel bara se alla enheter från en produktgrupp.\n\nI själva besiktningslistan kan du hitta enhetstnamn, Renta ID, produktgrupp, depå, enhetens status, föregående besiktningsdatum och nästa besiktnings förfallodatum.\n\nAlla enheter är färgkodade:\n\n<b>Vit, utan datum</b>\n\nInga årliga inspektionsdata finns tillgängliga. Det finns inga poster i enhetens inspektionsregister. Du bör kontrollera dessa enheter och mata in nödvändig data till Renta Tools.\n\n<b>Vit, med datum</b>\n\nDen årliga besiktningen ska ske om mer än en månad.\n\n<b>Blå</b>\n\nDessa enheter har en månad kvar tills den årliga inspektionen ska genomföras.\n\n<b>Gul</b>\n\nDessa enheter har två veckor kvar tills den årliga inspektionen ska genomföras.\n\n<b>Röd</b>\n\nDen årliga besiktningen är sen! Förfallodagen för nästa årliga besiktning har överskridits.` }, { language: `pl`, value: `Ta strona pokazuje wszystkie przeglądy roczne z każdego oddziału, włączając w to: nadchodzące oraz zaległe, minione oraz zakończone przeglądy, które czekają na komentarz.\n\nBy wybrać, który przegląd chcesz zobaczyć, posłuż się zakładkami Nadchodzące, Uwagi, Minione.\n\nUżywając pomarańczowej ikony filtra można zawęzić liczbę maszyn pojawiających się na liście. Dla przykładu, można wyświetlić maszyny przynależne jedynie do jednej grupy.\n\nNa liście przeglądów można zobaczyć nazwę urządzenia, jego kod, grupę produktową, kod oddziału, status maszyny, datę poprzedniego oraz następnego przeglądu.\n\nWszystkie maszyny oznaczone są kolorem, w zależności od statusu:\n\n<b>Biały, bez dat</b>\n\nData rocznego przeglądu jest niedostępna. Nie ma żadnych zapisów związanych z tym przeglądem. Maszyny te powinny zostać sprawdzone, a daty, jeśli istnieje konieczność, uzupełnione.\n\n<b>Biały, z datami</b>\n\nTermin przeglądu rocznego przypada za ponad miesiąc.\n\n<b>Niebieski</b>\n\nTermin przeglądu rocznego przypada za mniej niż miesiąc.\n\n<b>Żółty</b>\n\nTermin przeglądu rocznego przypada za mniej niż dwa tygodnie.\n\n<b>Czerwony</b>\n\nTermin przeglądu rocznego upłynął!` }, { language: `nb`, value: `Denne siden viser alle årskontroller for hvert depot inkludert: kommende og for sene årskontroller, tidligere årskontroller samt gjennomførte årskontroller som fortsatt venter på at anmerkninger skal rettes.\n\nDu kan bruke fanene Kommende, Merknader og Tidligere for å velge hvilken årskontroll-liste du ønsker å se.\n\nVed å bruke det oransje filterikonet kan du begrense elementene som vises på listen. For eksempel kan du bare se alle enheter fra én produktgruppe.\n\nI selve årskontroll-listen kan du finne enhetsnavn, Renta ID, produktgruppe, depotnummer, enhetsstatistikk til forrige inspeksjonsdato og neste inspeksjons forfallsdato.\n\nAlle enheter er fargekodet etter status:\n\n<b>Hvit, uten datoer</b>\n\nIngen årskontroll data er tilgjengelige. Det er ingen oppføringer i denne enhetens inspeksjonsposter. Du bør sjekke disse enhetene og legge inn de nødvendige dataene til Renta Tools.\n\n<b>Hvit, med datoer</b>\n\nÅrskontroll skal utføres mer enn en måned fra nå.\n\n<b>Blå</b>\n\nDisse enhetene har en måned igjen til årskontroll skal utføres.\n\n<b>Gul</b>\n\nDisse enhetene har to uker igjen til årskontroll skal utføres.\n\n<b>Rød</b>\n\nÅrskontroll er forsinket! Frist for neste årlige kontroll er overskredet.` }, { language: `en`, value: `This page shows all annual inspections for each depot including: upcoming and late annual inspections, past annual inspections as well as completed annual inscpetions which are still waiting for remarks to be corrected.\n\nYou can use the tabs Upcoming, Remarks and Past to select which annual inspection list you want to view.\n\nUsing the orange filter icon, you can narrow down the items appearing on the list. For example, you can only view all devices from one product group.\n\nIn the inspection list itself you can find device name, Renta ID, product group, depot number, device statsu previous inspection’s date and next inspection’s due date.\n\nAll devices are colour coded by their status:\n\n<b>White, without dates</b>\n\nNo annual inspection data is available. There are no entries in this device’s inspection records. You should check these devices and input the necessary data to Renta Tools.\n\n<b>White, with dates</b>\n\nAnnual inspection is due more than one month from now.\n\n<b>Blue</b>\n\nThese devices have one month left until annual inspection is due.\n\n<b>Yellow</b>\n\nThese devices have two weeks left until annual inspection is due.\n\n<b>Red</b>\n\nAnnual inspection is late! The due date for the next annual inspection has been exceeded.` }, { language: `da`, value: `Denne side viser alle årlige inspektioner for hver afdeling, herunder: kommende og forsinket årlige inspektioner, tidligere årlige inspektioner samt afsluttede årlige inspektioner, som stadig venter på rettelser.\n\nDu kan bruge fanerne Kommende, Bemærkninger og Tidligere til at vælge, hvilken årlig inspektionsliste du vil se.\n\nVed hjælp af det orange filterikon kan du indsnævre de elementer, der vises på listen. Du kan f.eks. kun se alle enheder fra én produktgruppe.\n\nI selve inspektionslisten kan du finde Individsnavn, individ ID, produktgruppe, afdelingsnummer, enhedsstatistik for tidligere inspektionsdato og næste inspektions forfaldsdato.\n\nAlle enheder er farvekodede efter deres status:\n\n<b>Hvid, uden datoer</b>\n\nDer foreligger ingen årlige inspektionsdata. Der er ingen poster i dette individs inspektionsoptegnelser. Du bør kontrollere disse individer og indtaste de nødvendige data til Renta Tools.\n\n<b>Hvid, med dadler</b>\n\nÅrligt eftersyn skal ske om mere end en måned.\n\n<b>blå</b>\n\nDisse individer har en måned tilbage, indtil den årlige inspektion forfalder.\n\n<b>gul</b>\n\nDisse individer har to uger tilbage, indtil den årlige inspektion forfalder.\n\n<b>rød</b>\n\nÅrlig inspektion er sent! Forfaldsdatoen for den næste årlige inspektion er overskredet.` },);
        this.set(this.servicedDevicesInfoHeaderLanguageItemName, { language: `fi`, value: `Sivun ohjeet: Huollot & korjaukset lista` }, { language: `sv`, value: `Sidinstruktioner: Lista över service och reparationer` }, { language: `pl`, value: `Instrukcja strony: Lista napraw i serwisów` }, { language: `nb`, value: `Sideinstruksjoner: Liste over servicer og reparasjoner` }, { language: `en`, value: `Page instructions: Services & repairs list` }, { language: `da`, value: `Page instructions: Services & repairs list` },);
        this.set(this.servicedDevicesInfoContentLanguageItemName, { language: `fi`, value: `Tällä sivulla näet kunkin toimipisteen kaikki odottavat ja äskettäin suoritetut huollot ja/tai korjaukset.\n\nJokainen listan kohde näyttää seuraavat tiedot:\n\n- Renta-numero\n\n- Toimipisteen numero\n\n- Laitteen nimi\n\n- Päivämäärä, milloin laite on asetettu huoltoon tai korjattavaksi\n\n- Tuoteryhmän nimi\n\n- Huollon tai korjauksen tila\n\n- Lyhyt kuvaus\n\nListan ulkoasun kokoa voi muuttaa klikkaamalla ikonia, jossa on kolme valkoista viivaa päällekkäin.\n\nHuolto- ja korjauslista on myös värikoodattu:\n\n\n<b>Oranssi</b> - Odottaa huoltoa tai korjausta\n\n\n<b>Vihreä</b> - Huolto tai korjaus käynnissä\n\n\n<b>Sininen</b> - Valmis huolto tai korjaus \n\n      \n\nKäyttämällä sininstä suodatusikonia voit rajata listalla näytettävien kohteiden määrää. Voit esimerkiksi suodattaa laitteet yhdestä tietystä tuoteryhmästä. Oletusarvona näet laitteet, jotka odottavat huoltoa tai korjausta sekä laitteet joiden huolto tai korjaus on käynnissä. Jos haluat tarkastella valmistuneita huoltoja tai korjauksia, valitse “Huollon tilanne” valikosta vaihtoehto “Valmis”.\n\nOletuksena voit tarkastella vain oman toimipisteesi laitteita, mutta jos sinulla on oikeus tarkastella muiden toimipisteiden laitteita, saatat nähdä listassa useamman kuin yhden varastonumeron.\n\nListan riviä painamalla pääset tarkastelemaan kyseisen laitteen omaa sivua.` }, { language: `sv`, value: `Den här sidan visar pågående och nyligen genomförd service och/eller reparationer på depån.\n      \n\nVarje listobjekt visar följande information:\n      \n\n- Renta nummer\n\n- Depå\n\n- Märke/modell\n\n- Datum då enheten sattes i service / reparation\n\n- Benämning\n\n- Status för service/reparation\n      \n\n- Kommentar\n      \n\nIntervall för de listobjekt som du kan hantera med hjälp av ikonen med tre vita horisontlinjer. \n\nS&R-listan har också en färgkod:\n\n<b>orange</b> - väntar på service/reparation\n\n<b>grön</b> - Pågående service / reparation\n\n<b>blå</b> - Slutförd\n\nMed hjälp av den blå filterikonen kan du begränsa de objekt som visas i listan. Du kan till exempel visa alla enheter från en produktgrupp. Som standard kan du bara se enheter som väntar på service/reparation eller pågående. Om du vill se "Slutförda" kan du välja "Avslutad" i fältet Servicestatus.\n      \n\nSom standard kan du bara se din egen depås enheter, men om du har behörighet att se andra depåers enheter kan du se mer än en depå i listan.\n      \n\nGenom att klicka på ett objekt i listan kan du visa sidan för enheten i fråga.` }, { language: `pl`, value: `Ta strona pokazuje wszystkie trwające lub ostatnio zakończone serwisy i naprawy dla każdego oddziału.\n\nKażdy element na liście wskazuje informacje:\n\n- Kod Renta\n\n- Numer oddziału\n\n- Nazwa urządzenia\n\n- Data, kiedy urządzenie znalazło się na liście\n\nPoprzez kliknięcie w urządzenie na liście, można dostać się do strony urządzenia. \n\nUżywając filtra oznaczonego niebieskim kolorem możesz zawęzić liczbę urządzeń pojawiających się na liście. Dla przykładu, listę można zawęzić do maszyn należących tylko do jednej grupy produktowej.\n\nDomyślnie możesz zobaczyć jedynie urządzenia, które podlegają kontroli powrotnej lub są w jej trakcie. Jeśli chcesz zobaczyć zakończone kontrole musisz wybrać filtr "Zakończone".` }, { language: `nb`, value: `Denne siden viser alle ventende og nylig fullførte servicer og/eller reparasjoner for hvert depot.\n\nHvert listeelement viser følgende informasjon:\n\n-Renta ID\n\n-Depotnummer\n\n-Produktnavn\n\n-Dato når enheten ble satt i service/reparasjon\n\nVed å klikke på et element i listen kan du se siden til den aktuelle enheten.\n\nVed å bruke det blå filterikonet kan du begrense elementene som vises på listen. For eksempel kan du bare se alle enheter fra én produktgruppe.\n\nSom standard kan du bare se ditt eget depots enheter, men hvis du har rettigheter til å se andre depots enheter, kan du se mer enn ett depotnummer i listen.\n\nI listen over betjente enheter kan du se de 10 sist fullførte enhetene og fullføringsdatoen.` }, { language: `en`, value: `This page shows all pending and recently completed services and/or repairs for each depot.\n\nEach list item shows the following information:\n\n- Renta ID\n\n- Depot number\n\n- Device name\n\n- Date when the device was placed in service/repair\n\n- Group name\n\n- Status of service/repair\n      \n- Fault comment\n\n \n\nRange of the list items you can manage using the icon with three white horizon lines. \n\n \n\nThe S&R list also has a color code:\n\n<b>orange</b> - waiting for the service/repair\n\n<b>green</b> - S&R is in progress\n\n<b>blue</b> - completed \n      \n\nUsing the blue filter icon, you can narrow down the items appearing on the list. For example, you can only view all devices from one product group. By default, you can see only devices that waiting for the Service/Repair or In progress. If you want to see the “Completed services” you can choose “Completed” in the Service status field.\n\nBy default, you can only view your own depot’s devices but if you have rights to view other depot’s devices, you may see more than one depot number in the list.\n\nBy clicking an item in the list, you can view the page of the device in question.` }, { language: `da`, value: `Denne side viser alle ventende og nyligt afsluttede Inspektioner og/eller reparationer for hver afdeling.\n\nHver liste "element" viser følgende oplysninger:\n\n-Renta ID\n\n-Afdeling\n\n-Individ navn\n\n-Dato, hvor Individ\n\n- Dato, hvor individ blev sat til service/repareret\n\n- Gruppens navn\n\n- Status på service/reparation\n      \n- Fejl kommentar\n\nOmråde af list elementerne, du kan administrere ved hjælp af ikonet med tre hvide horisontlinjer. \n\nS&R-listen har også en farvekode:\n\n<b>Orange</b> - venter på service/reparation\n\n<b>grøn</b> - S&R er i gang\n\n<b>blå</b> - afsluttet \n\n\nVed hjælp af det blå filterikon kan du indsnævre de individer, der vises på listen. Du kan f.eks. kun se alle individer fra én produktgruppe.\n\nSom standard kan du kun se dine egne Som standard kan du kun se individer, der venter på service/reparation eller i gang.\nHvis du vil se "Afsluttede service/inspektioner", kan du vælge "Afsluttet" i feltet Servicestatus.\n\nSom standard kan du kun se dit egen afdelings individer, men hvis du har rettigheder til at se andre afdelingers individer, kan du muligvis se mere end ét afdelingsnummer på listen.\n\nVed at klikke på et element på listen kan du se siden for den pågældende enhed.` },);
