        this.set(this.deviceAnnualInspectionFormPageInspectionDoneRecentlyLanguageItemName, { language: `fi`, value: `Laitteelle on suoritettu määräaikaistarkastus viimeisen kuukauden sisällä. Oletko varma että haluat tallentaa uuden määräaikaistarkastuksen?` }, { language: `sv`, value: `Årlig inspektion har nyligen slutförts för denna enhet. Är du säker på att du vill spara en ny årlig besiktning?` }, { language: `pl`, value: `Niedawno ukończono roczny przegląd dla tego urządzenia. Jesteś pewien, że chcesz zapisać nowy roczny przegląd?` }, { language: `nb`, value: `Årskontroll har nylig blitt fullført for denne enheten. Er du sikker på at du vil lagre en ny årskontroll?` }, { language: `en`, value: `Annual inspection has been completed recently for this device. Are you sure you want to save a new annual inspection?` }, { language: `da`, value: `Årlig inspektion er afsluttet for nylig for denne enhed. Er du sikker på, at du vil gemme et nyt årligt eftersyn?` },);
        this.set(this.takePicturesPageInfoHeaderLanguageItemName, { language: `fi`, value: `Sivun ohjeet: Kirjaa havainto tai huomio` }, { language: `sv`, value: `Sidinstruktioner: Skriv ner en observation eller anteckning.` }, { language: `pl`, value: `Instrukcje strony: Zapisz obserwację lub notatkę.` }, { language: `nb`, value: `Sidens instruksjoner: Skriv ned en observasjon eller merknad.` }, { language: `en`, value: `Page instructions: Record an observation or note.` }, { language: `da`, value: `Sideinstruktioner: Optag en observation eller note.` },);
        this.set(this.takePicturesPageInfoContentLanguageItemName, { language: `fi`, value: `Tällä sivulla voit tehdä havaintoja tai huomioita laitteesta ja sen kunnosta milloin tahansa. Tehdyt havainnot ja huomiot tallennetaan koneen historiaan ja löydät ne koneen palautustarkastushistorian yhteydestä.\n##\n<b>Selaa- ja Kamera-painikkeet</b>\n##\n##\n##\n\nNäillä painikkeilla voit lisätä tai ottaa valokuvan tekemästäsi havainnosta. Selaa-painike avaa mobiililaitteen tai tietokoneen tiedostot, josta voit lisätä valokuvia. Kamera-painike avaa mobiililaitteen kameran valokuvan ottamista varten. Voit tarvittaessa lisätä tai ottaa useampia valokuvia.\n##\n<b>Kuvankäsittelypainikkeet</b>\n##\nJos havaintosi sisältää jo kuvia, voi valita minkä tahansa lisätyistä kuvista ja käsitellä sitä suoraan Toolsissa. Valittaessa kuva esiin tulee seuraavat työkalut:\n##\n<small>Kuvan kierto</small>\n\n##\nJos kuva on väärin päin, voit kiertää kuvaa vasemmalle tai oikealle näillä näppäimillä.\n\n##\n<small>Kuvan muokkaus</small>\n\n##\nJos haluat rajata kuvasta näkyviin vain tietyn osan, voit tehdä sen tällä näppäimellä. Painettaessa ruutuun aukeaa rajaustyökalu, jonka rajoja raahaamalla voit rajata kuvaan vain haluamasi kohdan. Samalla voit myös kiertää kuvaa vasemmalle ja oikealle.\nMuistathan tallentaa muokkauksesi!\n##\n<small>Esikatsele</small>\n\n##\nTällä painikkeella voit näyttää valitsemasi kuvan ruudulla suurempana.\n##\n<small>Poista</small>\n\n##\nTämä painike poistaa valitsemasi kuvan. Poistettua kuvaa ei voi enää palauttaa, vaan kuva tulee lisätä laitteesta tai ottaa kameralla uudelleen.\n##\n<b>Kommentti</b>\n##\nTähän kenttään voit syöttää haluamasi kommentit koskien laitteesta tekemääsi havaintoa tai huomiota. Kuvan lisäksi kommentti on aina suositeltavaa kirjoittaa, jotta tehty havainto tai huomio olisi mahdollisimman selkeä.\n##\n<b>Tallenna-painike</b>\n\n##\nTällä painikkeella voit tallentaa tekemäsi havainnon tai huomion. Painike on aktiivinen vasta, kun vähintään yksi valokuva on syötetty lomakkeelle.\n##\n<small>Takaisin</small>\n\n##\nTämä painike vie tallentamatta takaisin edelliselle sivulle. ` }, { language: `sv`, value: `TaBilderSida.Info.Innehåll` }, { language: `pl`, value: `StronaRobieniaZdjęć.Informację.Zawartość` }, { language: `nb`, value: `` }, { language: `en`, value: `` }, { language: `da`, value: `` },);
        this.set(this.reportDefinitionPageDuplicateResourceTypeErrorMessageLanguageItemName, { language: `fi`, value: `Resursseilla voi olla vain yksi vaihe resurssityyppiä kohden` }, { language: `sv`, value: `Resurser kan bara ha ett steg per resurstyp` }, { language: `pl`, value: `Zasoby mogą mieć tylko jeden krok na typ zasobu` }, { language: `nb`, value: `Ressurser kan bare ha ett trinn per ressurstype` }, { language: `en`, value: `Resources can have only one step per resource type` }, { language: `da`, value: `Ressourcer kan kun have ét trin pr. ressourcetype` },);
