        this.set(this.returnInspectionContinueErrorOldInpsectionLanguageItemName, { language: `fi`, value: `Valitettavasti et voi jatkaa palautustarkastusta, joka on aloitettu ohjelman vanhassa versiossa. Peruuta tarkastus ja aloita alusta.` }, { language: `sv`, value: `Tyvärr är det inte möjligt att fortsätta inspektionen, som påbörjades i den gamla versionen av inspektionen. Avbryt inspektionen och starta den igen.` }, { language: `pl`, value: `Kontynuacja inspekcji rozpoczętej w starszej wersji jest niemożliwa. Anuluj inspekcję i rozpocznij ją od nowa.` }, { language: `nb`, value: `Dessverre er det ikke mulig å fortsette kontrollen, startet i den gamle versjonen av Returkontrollen. Vennligst avbryt kontrollen og start den på nytt.` }, { language: `en`, value: `Unfortunately, continuing the inspection, started in the old version of Return Inspection is not possible. Please, cancel the inspection and start it.` }, { language: `da`, value: `Desværre er det ikke muligt at fortsætte inspektionen, der blev startet i den gamle version af Return Inspektion. Annuller venligst inspektionen og start den.` },);
        this.set(this.returnedDevicesPageInfoHeaderLanguageItemName, { language: `fi`, value: `Sivun ohjeet: Palautustarkastusluettelo` }, { language: `sv`, value: `Sidanvisningar: Returbesiktningslista` }, { language: `pl`, value: `Instrukcja strony: Lista kontroli powrotnych` }, { language: `nb`, value: `Sideveiledning: Returkontrollliste` }, { language: `en`, value: `Page instructions: Return inspection list` }, { language: `da`, value: `Sidevejledning: Returinspektionsliste` },);
        this.set(this.returnedDevicesPageInfoContentLanguageItemName, { language: `fi`, value: `Tällä sivulla näkyy jokaisen varaston kaikki vireillä olevat ja äskettäin suoritetut palautustarkastukset.\n\n\n\nJokaisella rivillä näytetään seuraavat tiedot:\n\n\n\n-Renta-numero\n\n\n\n-Toimipisteen numero\n\n\n\n-Laitteen nimi\n\n\n\n-Tarkastuksen tila\n\n\n\n-Tarkastusta parhaillaan tekevä käyttäjätunnus\n\n\n\n-Palautuspäivä, jos laite odottaa palautustarkastusta, tai viimeinen tarkastuspäivä, jos laite muussa tilassa\n\n\n\nPalautustarkastusluettelo on myös värikoodattu:\n\n\n\n<b>Oranssi</b> - Odottaa palautustarkastusta\n\n\n\n<b>Vihreä</b> - Palautustarkastus on käynnissä\n\n\n\n<b>Keltainen</b> (toistaiseksi käytössä vain Ruotsissa) - Tarkastus on osittain valmis: yksi käyttäjä on suorittanut osan tarkastuksesta, tallentanut oman osuutensa ja tarkastus on valmis jatkettavaksi toisen käyttäjän toimesta.\n\n\n\n<b>Punainen</b> (huutomerkillä) - Priorisoitu tarkastus\n\n\n\n<b>Sininen</b> - Palautustarkastus suoritettu\n\n\n\nJos tarkastus sisältää tankkaus- tai puhdistusvaiheita, näet luettelokohdassa asiaankuuluvat kuvakkeet.\n\n\n\nNapsauttamalla listassa olevaa kohdetta pääset tarkastelemaan kyseisen laitteen sivua, jolta pääset edelleen aloittamaan palautustarkastuksen. \n\n\n\nKlikkaamalla polttoaine- tai puhdistuskuvaketta tuoteluettelossa, sinut ohjataan suoraan asiaankuuluvaan palautustarkastuksen vaiheeseen.\n\n\n\nSivun yläosan sinisen suodatinkuvakkeen avulla voit rajata luettelossa näkyviä kohteita. Voit esimerkiksi tarkastella vain yhden tuoteryhmän laitteita.\nOletusarvoisesti näet vain laitteet, jotka odottavat palautustarkastusta tai ovat palautustarkastettavana. Jos haluat nähdä myös tilassa “Valmis” olevat laitteet, voit valita Palautustarkastuksen tila -kentästä "Valmis".\n\n\n\nOletuksena voit tarkastella vain oman toimipisteesi laitteita, mutta jos sinulle on myönnetty lisäoikeuksia tarkastella myös muiden toimipisteiden laitteita, saatat nähdä luettelossa useamman kuin yhden toimipistenumeron.` }, { language: `sv`, value: `Den här sidan visar alla pågående och nyligen genomförda returinspektioner för varje depå.\n\n\n\nVarje listobjekt visar följande information:\n\n\n\n-Renta ID\n\n\n\n-Depånummer\n\n\n\n-Enhetsnamn\n\n\n\n-Status för inspektionen\n\n\n\n-Användarnamn som arbetar med besiktningen\n\n\n\n-Returdatum (eller senaste inspektionsdatum)\n\n\n\nReturbesiktningslistan har även en färgkod:\n\n\n\n   \n\n\n\n<b>orange</b> - väntar på besiktningen\n\n\n\n<b>grön</b> - inspektion pågår\n\n\n\n<b>gul</b> - inspektionen är delvis klar: en användare har slutfört en del av inspektionen, sparat den och inspektionen är redo att fortsätta med en annan användare (endast tillgänglig för Tools SE för närvarande)\n\n\n\n<b>röd</b> (med utropstecken) - högprioriterad inspektion\n\n\n\n<b>blå </b> genomförd besiktning\n\n\n\nOm inspektionen inkluderar tanknings- eller rengöringssteg kommer du att se relevanta ikoner i listobjektet.\n\n\n\nGenom att klicka på ett objekt i listan kan du se sidan för enheten i fråga. Genom att klicka på bränsle- eller rengöringsikonen i objektlistan kommer du att vidarebefordras till det relevanta steget.\n\n\n\nMed den blå filterikonen kan du begränsa objekten som visas på listan. Du kan till exempel bara se alla enheter från en produktgrupp.\nSom standard kan du bara se enheter som väntar på returbesiktningen eller under inspektionen. Om du vill se den slutförda besiktningen kan du välja "Slutförd" i fältet Returbesiktningsstatus.\n\n\n\nSom standard kan du bara se din egen depås enheter men om du har rätt att se andra depås enheter kan du se mer än ett depånummer i listan.` }, { language: `pl`, value: `Ta strona pokazuje wszystkie trwające i ostatnio zakończone kontrole powrotne dla każdego oddziału.\n\nKażdy element na liście wskazuje informacje:\n\n-Kod Renta\n\n-Numer oddziału\n\n-Nazwę urządzenia\n\n-Status kontroli\n\n-Nazwa użytkownika, który dokonuje kontroli\n\n-Datę zwrotu (lub datę ostatniej kontroli)\n\nLista kontroli powrotnych posiada również swój kolorystyczny kod:\n\n<b>pomarańczowy</b> - czeka na kontrolę\n\n<b>zielony</b> - trwająca kontrola\n\n<b>żółty</b> - kontrola częściowo zakończona\n\n<b>czerwony</b> (z wykrzyknikiem) - kontrola o wysokim priorytecie\n\n<b>niebieski</b> - kontrola zakończona\n\nJeśli z kontrolą są powiązane koszty czyszczenia lub tankowania, odpowiednie ikony pojawią się na liście. \n\nPoprzez kliknięcie w urządzenie na liście, można dostać się do strony urządzenia. Po naciśnięciu ikony tankowania lub czyszczenia zostaniesz przeniesiony do odpowiedniego modułu aplikacji.\n\n\nUżywając filtra oznaczonego niebieskim kolorem możesz zawęzić liczbę urządzeń pojawiających się na liście. Dla przykładu, listę można zawęzić do maszyn należących tylko do jednej grupy produktowej.\nDomyślnie możesz zobaczyć jedynie urządzenia, które podlegają kontroli powrotnej lub są w jej trakcie. Jeśli chcesz zobaczyć zakończone kontrole musisz wybrać filtr "Zakończone".\n\nDomyślnie możesz zobaczyć urządzenia tylko ze swojego oddziału. Jeśli jesteś uprawniony do oglądania urządzeń z innych oddziałów, pojawią się na tej liście.` }, { language: `nb`, value: `Denne siden viser alle ventende og nylig gjennomførte returinspeksjoner for hvert depot.\n\n\n\nHvert listeelement viser følgende informasjon:\n\n\n\n-Leie ID\n\n\n\n-Depotnummer\n\n\n\n-Enhets navn\n\n\n\n- Status for inspeksjonen\n\n\n\n-Brukernavn som jobber med kontrollen\n\n\n\n-Returdato (eller siste inspeksjonsdato)\n\n\n\nReturinspeksjonslisten har også en fargekode:\n\n\n\n<b>oransje</b> - venter på inspeksjonen\n\n\n\n<b>grønn</b> - inspeksjon pågår\n\n\n\n<b>gul</b> - inseksjon er delvis fullført: én bruker har fullført en del av inspeksjonen, lagret den og inspeksjonen er klar til å fortsette med en annen bruker (bare tilgjengelig for Tools SE foreløpig)\n\n\n\n<b>rød</b> (med utropstegn) - høyprioritet inspeksjon\n\n\n\n<b>blå</b> - fullført inspeksjon\n\n\n\nHvis inspeksjonen inkluderer tanking eller rengjøringstrinn, vil du se relevante ikoner i listeelementet. \n\n\n\nVed å klikke på et element i listen kan du se siden til den aktuelle enheten. Ved å klikke på drivstoff- eller rengjøringsikonet i varelisten, blir du videresendt til det aktuelle trinnet.\n\n\n\n\nVed å bruke det blå filterikonet kan du begrense elementene som vises på listen. For eksempel kan du bare se alle enheter fra én produktgruppe.\nSom standard kan du bare se enheter som venter på returinspeksjonen eller under inspeksjonen. Hvis du vil se Fullført inspeksjon, kan du velge "Fullført" i feltet Returinspeksjonsstatus.\n\n\n\nSom standard kan du bare se ditt eget depots enheter, men hvis du har rett til å se andre depots enheter, kan du se mer enn ett depotnummer i listen.` }, { language: `en`, value: `This page shows all pending and recently completed return inspections for each depot.\n\n\n\nEach list item shows the following information:\n\n\n\n-Renta ID\n\n\n\n-Depot number\n\n\n\n-Device name\n\n\n\n-Status of the inspection \n\n\n\n-User name who is working with the inspection\n\n\n\n-Return date (or last inspection date)\n\n\n\nThe return inspection list also has a color code: \n\n\n\n<b>orange</b> - waiting for the inspection \n\n\n\n<b>green</b> - inspection is in progress\n\n\n\n<b>yellow</b> - insection is partly completed: one user has completed part of the inspection, saved it and the inspection is ready to be continued with another user (available for Tools SE only for now)\n\n\n\n<b>red</b> (with exclamation mark) - high-priority inspection\n\n\n\n<b>blue</b> - completed inspection \n\n\n\nIf the inspection includes fueling or cleaning steps, you will see relevant icons in the list item. \n\n\n\nBy clicking an item in the list, you can view the page of the device in question. By clicking the fuel or cleaning icon in the item list, you will be forwarded to the relevant step. \n\n\n\n\nUsing the blue filter icon, you can narrow down the items appearing on the list. For example, you can only view all devices from one product group.\nBy default, you can see only devices that waiting for the Return Inspection or under the Inspection. If you want to see the Completed inspection you can choose “Completed” in the Return inspection status field. \n\n\n\nBy default, you can only view your own depot’s devices but if you have the right to view other depot’s devices, you may see more than one depot number in the list.` }, { language: `da`, value: `Denne side viser alle afventende og nyligt afsluttede returinspektioner for hver afdeling.\n\nHvert liste individ viser følgende oplysninger:\n\n-Renta ID\n\n-Afdelings nummer\n\n-Individ navn\n\n-Status for inspektionen\n\n-Brugernavn, der arbejder med inspektionen\n\n-Returdato (eller sidste inspektionsdato)\n\nReturinspektionslisten har også en farvekode:\n\n<b>orange</b> - venter på inspektionen\n\n<b>grøn</b> - inspektion er i gang\n\n\n<b>gul</b> - inspektion er delvist afsluttet: en bruger har gennemført en del af inspektionen, gemt den, og inspektionen er klar til at blive fortsat med en anden bruger (kun tilgængelig for Tools SE indtil videre)\nnn\n<b>rød</b> (med udråbstegn) - inspektion med høj prioritet\nnn\n<b>blå</b> - afsluttet inspektion \nnn\nHvis inspektionen omfatter brændstofpåfyldning eller rengøringstrin, vil du se relevante ikoner i listeelementet. \n\nVed at klikke på et element på listen kan du se siden for det pågældende individ. Ved at klikke på brændstof- eller rengøringsikonet på varelisten videresendes du til det relevante trin. \n\nVed hjælp af det blå filterikon kan du indsnævre de elementer, der vises på listen. Du kan f.eks. kun se alle individer fra én produktgruppe.\n\n\nSom standard kan du kun se individer, der venter på returinspektionen eller under inspektionen. Hvis du vil se Fuldført inspektion, kan du vælge "Fuldført" i feltet Status for returinspektion. \n\nSom standard kan du kun se din egen afdelings individer, men hvis du har ret til at se andre afdelingers individer, kan du muligvis se mere end ét afdelingsnummer på listen.\n` },);
        this.set(this.servicedDeviceListTitleUnInspectedLanguageItemName, { language: `fi`, value: `Huoltamatta` }, { language: `sv`, value: `Oservade enheter` }, { language: `pl`, value: `Urządzenia wymagające serwisu` }, { language: `nb`, value: `Ikke-vedlikeholdte enheter` }, { language: `en`, value: `Un-serviced devices` }, { language: `da`, value: `Ikke-servicerede individer` },);
